import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
const MangaItem = () => {
  return (
    <Card sx={{ maxWidth: 345 }} className="item-manga">
      <CardMedia
        sx={{ height: 140 }}
        image="~/public/Uploads/manga/1.png"
        title="Boku no girl"
        className="img-manga"
      />
      <CardContent className="item-manga-conten" >
        <Typography gutterBottom variant="h5" component="div" className="title-manga">
          Boku no girl
        </Typography>
        <Typography variant="body2" color="text.secondary" className="price-manga">
          20000 VND
        </Typography>
      </CardContent>
    </Card>
  );
};

export default MangaItem;
